import React from "react"
import {Container} from "reactstrap"


const Footer = () => {return (
    <Container 
    fluid
    tag = "footer"
    className = "text-center bg-info text-white text-uppercase fixed-bottom pd-3">
    
    LCO Github search app with firebase
    
    </Container>
)

}

export default Footer;
